# import the needed libraries
from matplotlib import pyplot as plt
import seaborn as sn
import pandas as pd
import numpy as np
import tensorflow as tf
import tensorflow_hub as hub
import tensorflow_text as text

"""###Import the dataset (Dataset is taken from kaggle)

"""

# read and show snippets of the dataset
df = pd.read_csv("spam.csv")
df.head(5)

"""###Data Exploration"""

df['Category'].value_counts()

"""Clearly, there is some imbalance in this dataset


---

To deal with imbalances of data, we will use a technique called ***down sampling***


Which says that from 4825 ham emails pick any random sample of 747 samples.
"discard the rest of them"


*  that way we have an equal number of spam and ham emails


---
`This  technique might not be good for certain cases since we are losing our training data`
"""

747/4825

"""- **15%** spam emails, **85%** ham emails: This indicates class imbalance

###Create seperate dataframe for ham and spam emails
"""

# create new dataframe with spam emails only
df_spam = df[df['Category']=='spam']
df_spam.shape

# create new dataframe with ham emails only
df_ham = df[df['Category']=='ham']
df_ham.shape

# pick sample of 747 from ham emails
df_ham_downsampled = df_ham.sample(df_spam.shape[0])
df_ham_downsampled.shape

# concat those spam and sample of ham dataframes
df_balanced = pd.concat([df_ham_downsampled, df_spam])
df_balanced.shape

# checking
df_balanced['Category'].value_counts()

"""Now we will create a new column called spam because here there's a two text-column and we want to create one binary column instead.



* we will use the function "apply" so that we can apply some transformation (using any python function) on the category column 
* since this is a simple function, we will use lambda which is a quick way of writing a function
"""

df_balanced['spam'] = df_balanced['Category'].apply(lambda x: 1 if x=='spam' else 0)
df_balanced.sample(5)

"""###Split it into training and test data set

We will split the data set into 15% for testing and 85% for training.

Also, we will use **stratify** so that in your train and test sample the distribution of the categories is equal.
"""

from sklearn.model_selection import train_test_split
X_train, X_test, y_train, y_test = train_test_split(df_balanced['Message'],df_balanced['spam'],test_size=0.15, stratify=df_balanced['spam'])

# checking
X_train.head(4)

"""###Import BERT model and get embeding vectors for few sample statements

####Create Pre-process and encoder objects

In tensorflow hub we can find these trained models, so we will just using their url to downlowad those trained models

`Tensorflow hub is a repository of all the different models`


---

we can user the url to directly downloads the model or just use the url and create pre-process and enconder object

* bert preprocess: https://tfhub.dev/tensorflow/bert_en_uncased_preprocess/3
* bert encoder: https://tfhub.dev/tensorflow/bert_en_uncased_L-12_H-768_A-12/4

after getting the urls the next step is creating a hub

We can create hub layer and pass in our pre-process and encoder url
"""

bert_preprocess = hub.KerasLayer("https://tfhub.dev/tensorflow/bert_en_uncased_preprocess/3")
bert_encoder = hub.KerasLayer("https://tfhub.dev/tensorflow/bert_en_uncased_L-12_H-768_A-12/4")

'''
input: list of sentences

Output: list of 768 length vector "Tnesor" (word embedding)
'''

def get_sentence_embeding(sentences):
    preprocessed_text = bert_preprocess(sentences) # we will supply the output into bert encoder 

    # the encoder will return a dictionary but from that we need the pool output
    return bert_encoder(preprocessed_text)['pooled_output']

# for understanding about what would be produced as an output 
get_sentence_embeding([
    "500$ discount. hurry up", 
    "Bhavin, are you up for a volleybal game tomorrow?"]
)

"""the output of bert_preprocess function is pre-processed text and it's going to be dictionary ( if you want to know the keys : `preprocessed_text.keys() ` 
the output : 

```
dict_keys(['input_mask', 'input_type_ids', 'input_word_ids'])
```
* input_mask is 128 vector mask, a special token called **CLS** in the beginning and to separate two sentences it will put another special token called **SEP**, These special tokens and words in a sentence will be one and the rest of 128  values of vector will be 0

* input_type_ids would be useful if we have multiple sentences

* input_word_ids gives each word some unique ids  **Note:** the special tokens CLS and SEP have  101 and 102 ids respectivly.

---

the output of bert_encoder function is a dictionary:

```
dict_keys(['default', 'encoder_outputs', 'pooled_output', 'sequence_output'])
```

*  pooled_output is an embedding for the entire sentences and the embedding vector size is 768 

* sequence_output is individual word embedding vectors ( there is 768 vector size for each word) 

  * for each sentence there would be some padding to be 128 vector size 
  * for each word of those 128 there would be an 768 vector size

* encoder_outputs is output of each individual encoder of bert (for bert base there are 12 encoder while in  bert large there are 24 encoder)

![image.png](data:image/png;base64,)

##Build Model
There are two types of models you can build in tensorflow.

1. Sequential 
2. Functional

Below we will build functional model. 


More information on these two is here: https://becominghuman.ai/sequential-vs-functional-model-in-keras-20684f766057

* **The Functional model** offers more flexibility because we dont need to attach layers in sequential order. 

* To attach this layer with the previous layer, we need to explicitly write the layer variable at the end of this line.

* The final step of using the functional style is to initialize the entire architecture. It can be achieved using the Model() function along with its parameters which defines the input and output layer.


Both ways are fine, but it is also important to know how to do it using functional style since you can get more flexibility. For example, in sequential model you can only stack one layer after another, while in functional model you can connect a layer to literally any other layer.

![image.png](data:image/png;base64,)
"""

# Bert layers
text_input = tf.keras.layers.Input(shape=(), dtype=tf.string, name='text')
# we will pass the input layer to bert pre-process
preprocessed_text = bert_preprocess(text_input)
outputs = bert_encoder(preprocessed_text )


# Neural network layers
l = tf.keras.layers.Dropout(0.1, name="dropout")(outputs['pooled_output'])
l = tf.keras.layers.Dense(1, activation='sigmoid', name="output")(l)

# Use inputs and outputs to construct a final model
model = tf.keras.Model(inputs=[text_input], outputs = [l])

"""####starting with our input layer

the input shape will be derived based what encoding word is passing and then
the data type would be tf.string
the name parameter is the name of the layer (anything we want)

---

Dropout layer helps with overfitting
, 1% of neurons just drop
 Since it is a functional style, neural network we call it as if this is a function 
 and we need to supply an input which is the output pooled 
 (since it has your bert encoding 768 size vector)

 The second is dense layer and it has only one neuron 
 (is telling us weather email is spam or not)
 activation function is sigmoid because in sigmoid we know that
  * if it is more the 0.5 it's spam. 
  * less than 0.5 not spam

And agian this is a functional style so here in the function arguments
  you will pass whatever you got from your previous layer

---

So now we got our neural network layers defiend

We will construct a final model 

there are some inputs and output.
* Waht is our input? text input
* what is our output? l

**Note:** if you want to have multiple output or input layers this architicture allows you that. 
"""

# print a model summary
model.summary()

"""Here you can see, trainable parameters is 769 becuase 769 is the input and **the remaining parameters** are non-trainable because they are coming from bert and we don't need to worry about retraining them"""

len(X_train)

len(X_test)

METRICS = [
      tf.keras.metrics.BinaryAccuracy(name='accuracy'),
      tf.keras.metrics.Precision(name='precision'),
      tf.keras.metrics.Recall(name='recall')
]

model.compile(optimizer='adam',
              loss='binary_crossentropy',
              metrics=METRICS)

"""we will use 
1. adam as an optimizer
2. loss is binary cross-entropy because our output is binary (1 or 0).
3. as metrics we use a couple of them including accuracy we would use precision and recall

**Note:** the chosen metrics don't impact the actual training because the training is driven by the loss function but metrics are just printing these numbers so we can get an idea of how our training is working basically

###Train the model
"""

model.fit(X_train, y_train, epochs=10, validation_split=0.15)

"""###Model Evaluation"""

model.evaluate(X_test, y_test)

y_predicted = model.predict(X_test)

type(y_predicted)

y_predicted.ndim

y_predicted = y_predicted.flatten()

"""we we do model.predict the output is predicted y which is a two dimentional array. So we flatten it and it will become one dimentinal array """

y_predicted

"""Since y predicted is a bunch of sigmoid values ( 0.5, 0.7 ,...) I will do some transformation here:
1. if the value is greater than 0.5 put the value=1
2. Otherwize put value=0

After doing that, the predicted y is a bunch of ones and zeros 
"""

y_predicted = np.where(y_predicted > 0.5, 1, 0)
y_predicted

from sklearn.metrics import confusion_matrix, classification_report

cm = confusion_matrix(y_test, y_predicted)
cm

"""Now since we have both y predected and y test we can plot a confusion matrix to evaluate our model performance """

sn.heatmap(cm, annot=True, fmt='d')
plt.xlabel('Predicted')
plt.ylabel('Truth');

print(classification_report(y_test, y_predicted))

